import numpy as np
#diferentele finite inainte

def f(x):
    return (x**3-1) #functia de la punctul g)

def inainte(f, a, h):
    print("f'("+str(a)+")="+str((f(a+h)-f(a))/h)) #formula diferentei finite inainte

inainte(f, a=-1, h=0.1) # a= punctul in care calcula, h= pasul

import matplotlib.pyplot as plt

def inainte(f,a,h):
    return (f(a + h)-f(a))/(h)

x = np.linspace(0,-1,100)
derivata = inainte(f,x,0.01)

def f1(x): 
    return (3*(x**2))

plt.figure(figsize=(20,10))
plt.plot(x,derivata,'r.',label='Diferente inainte')
plt.plot(x,f1(x),'b',label='Derivata lui f')

plt.title('Derivata analitica si derivata numerica pentru f')
plt.legend(loc='best')
plt.show()

