"""##Integrare numerică

De cele mai multe ori pentru a integra I=∫f(x)dx (cu a și b capetele intervalului) ne folosim de formula I=F(b)-F(a).
Ce se întâmplă atunci când nu putem să găsim o primitivă F?
Apelăm la integrarea numerică. În acest sens avem o serie de formule care s-au dovedit a fi utile în aproximarea unui rezultat cât mai aproape de adevăr. Aceste formule se numesc Newton-Cotes:

###Formula trapezului

Această formulă aproximează suprafața de sub graficul functiei. Formula este:

![image.png](data:image/png;base64,)

Aproximarea obținută în urma folosirii acestei formule poate fi imbunatatita partiționând intervalul de integrare

![ex1a.jpg](data:image/jpeg;base64,)
"""

import numpy as np
def trapez(f,a,b,N=50):
    x = np.linspace(a,b,N+1)  # N+1 puncte formeaza N subintervale 
    y = f(x)
    y_right = y[1:] 
    y_left = y[:-1]
    dx = (b - a)/N
    T = (dx/2) * np.sum(y_right + y_left)
    return T
trapez(lambda x : 2/(x-4),0,0.5,100)

"""###Formula lui Simpson 1/3

Aproximarea obtinuta cu aceasta regula este exacta daca f are gradul cel mult 4

![image.png](data:image/png;base64,)

![ex1c.jpg](data:image/jpeg;base64,)
"""

import numpy as np
def simpson(f,a,b,N=50):
    if N % 2 == 1:
        raise ValueError("N trebuie sa fie un numar intreg")
    dx = (b-a)/N
    x = np.linspace(a,b,N+1)
    y = f(x)
    S = dx/3 * np.sum(y[0:-1:2] + 4*y[1::2] + y[2::2])
    return S
simpson(lambda x : 2/(x-4),0,0.5,100)

